import { FC } from 'react';
import { Button, Form, Input } from 'antd';

export const Login: FC = () => {
  const onSubmit = (values: any) => {
    console.log(values)
  }
  return(
    <div className={'container'}>
      <Form
      name = "basic"
      labelCol={{
        span: 8,
      }}
      onFinish={onSubmit}
      >
        <Form.Item
          label = "Name"
          name = "name"
          rules={[
            {
              required: true,
              message: "Укажите логин",
            },
          ]}
        >
          <Input />

        </Form.Item>
        <Form.Item
          label = "Password"
          name = "password"
          rules={[
            {
              required: true,
              message: "Укажите пароль",
            },
          ]}
        >
          <Input.Password />

        </Form.Item>

        <Form.Item
          wrapperCol={{
            offset: 8,
            span: 16,
          }}
        >
          <Button type="primary" htmlType>
            Войти
          </Button>

        </Form.Item>
      </Form>
    </div>
  )
}
